import "../assets/scss/discover.scss";

import React, { Component } from "react";

export default class Discover2 extends React.Component {
  state = {};
  componentDidMount() {}

  render() {
    return (
      <div className="discover">
        <div className="scrollable">
          <div className="container">
            <div className="textSection">
              <p className="text1">ciaoo</p>
              <p className="text2">hello</p>
              <p>hola</p>
              <p>hallo</p>
            </div>

            <div className="phone">
              <img
                alt="Phone frame"
                className="frame"
                src={require("../assets/img/iphone-frame.png")}
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}
